package Anudip;

public class NarrowCasting {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
      double shesh=111.886;
      int sheshana=(int)shesh;
      
   System.out.println("Original double value: "+ shesh);
   System.out.println("Narrowed int value: "+ sheshana); 
	
   
	}

}
